import axios from "axios";
import { useState, useEffect } from "react";
export default () => {
  const [recipes, SetRecipes] = useState([]);
  useEffect(() => {
    axios.get("http://localhost:8080/api/recipe")
      .then((data) => {
        SetRecipes(data.data)
      },[]);
  });
  return<>
  
  <hi>מתכונים-</hi>
  {recipes.map((x)=><div>{x.Name}</div>)}</>
}
